import{_ as e,Y as c,Z as t,a1 as i}from"./framework-5e11dbd9.js";const a={},o=i(`<h2 id="什么是-git-的-fork-命令-它和-clone-命令有什么区别" tabindex="-1"><a class="header-anchor" href="#什么是-git-的-fork-命令-它和-clone-命令有什么区别" aria-hidden="true">#</a> 什么是 Git 的 fork 命令？它和 clone 命令有什么区别？</h2><p>fork 命令可以将一个远程仓库复制到自己的 Git 账户上，形成一个新仓库，可以在自己账户上进行修改和管理，而不影响原仓库。如果想自己的修改合并到原仓库中，需要发起一个 Pull Request 请求，由原仓库管理员决定是否将其合并。</p><p>clone 命令是将一个远程仓库完整地复制到本地，包括历史提交记录和分支信息等，用户可以在本地进行修改，再将修改推送到远程仓库。</p><p>fork 命令主要用于贡献代码，clone 命令主要用于本地开发。</p><h2 id="什么是-git-的-cherry-pick" tabindex="-1"><a class="header-anchor" href="#什么是-git-的-cherry-pick" aria-hidden="true">#</a> 什么是 Git 的 cherry-pick？</h2><p>Git 的 cherry-pick 命令可以将其他分支的一个或多个提交应用到当前分支，而不需要合并整个分支。方便代码迁移、Bug 修复和应用补丁等操作。</p><p>执行 cherry-pick 命令：</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="shiki dark-plus" style="background-color:#1E1E1E;" tabindex="0"><code><span class="line"><span style="color:#DCDCAA;">git</span><span style="color:#D4D4D4;"> </span><span style="color:#CE9178;">cherry-pick</span><span style="color:#D4D4D4;"> &lt;</span><span style="color:#CE9178;">commit-has</span><span style="color:#D4D4D4;">h&gt; </span><span style="color:#CE9178;">...</span></span>
<span class="line"></span></code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><code>&lt;commit-hash&gt;</code> 为要应用的其他分支上提交的哈希值，可以有多个</p><p>如果应用某个提交时发生冲突，需要手动解决冲突，然后使用 <code>git add</code> 命令将修改的文件添加到暂存区，再使用 <code>git cherry-pick --continue</code> 命令继续执行 cherry-pick 操作</p><h2 id="git-pull-和-git-fetch-命令分别有什么作用-二者有什么区别" tabindex="-1"><a class="header-anchor" href="#git-pull-和-git-fetch-命令分别有什么作用-二者有什么区别" aria-hidden="true">#</a> git pull 和 git fetch 命令分别有什么作用？二者有什么区别？</h2><p>git pull 和 git fetch 命令都是用于从远程仓库的代码同步到本地仓库。区别如下：</p><ul><li><p><code>git fetch</code>：从远程仓库拉取最新的代码拉取到本地仓库，但不会自动合并到当前分支，需要手动执行 <code>git merge</code> 命令合并。使用 <code>git fetch</code> 可以查看远程仓库的更新情况，但不会影响本地仓库的代码</p></li><li><p><code>git pull</code>：从远程仓库拉取最新的代码到本地仓库，并自动合并到当前分支，如果发生冲突需要手动解决。相当于 <code>git fetch</code> 和 <code>git merge</code> 的结合。使用 <code>git pull</code> 可以快速更新本地仓库的代码，但是如果有冲突需要解决，可能会影响开发效率</p></li></ul>`,13),l=[o];function r(s,n){return c(),t("div",null,l)}const p=e(a,[["render",r],["__file","Git.html.vue"]]);export{p as default};
